    $(element).find('.form-row').css('pointer-events','auto');
    $(element).find('.checkboxmark').removeClass('sampleAnsCheckBoxMultiple');
    $(element).parent().find('input').parent().css('background-color', 'rgba(17, 62, 154, 0.3)');
    
