        //         return pair[1];
        //     }
        // }
        for (i = 0; i < vars.length; i++) {
          if (variable == 'courseId') {
            pair = vars[i].split("courseId=");
            return pair[1];
          } else if (variable == 'userToken') {
            pair = vars[i + 1].split("userToken=");
            return pair[1];
          } else if (variable == 'mode') {
            if (vars.length > 2) {
              pair = vars[i + 2].split("mode=");
              return pair[1];
            } else {
              return undefined;
            }
          }
        }
